https://pokeapi.co/api/v2/language/1/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"상대를 겨냥한 다음\n소방차의 호스보다\n강한 기세로 물을 뿜는다.","language":{"name":"ko","url":"https://pokeapi.co/api/v2/language/3/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"在鎖定了目標之後，\n會用比消防車的水龍\n更強的力道來射出水柱。","language":{"name":"zh-Hant","url":"https://pokeapi.co/api/v2/language/4/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"Une fois sa cible dans sa ligne de mire,\nil projette des jets d’eau plus puissants\nqu’une lance à incendie.","language":{"name":"fr","url":"https://pokeapi.co/api/v2/language/5/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"Nachdem es einen Gegner anvisiert hat, greift\nes mit einem Wasserstrahl an, dessen Druck\nhöher ist als der eines Feuerwehrschlauchs.","language":{"name":"de","url":"https://pokeapi.co/api/v2/language/6/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"Tras fijar el blanco, ataca disparando un chorro\nde agua a una presión mayor que la manguera\nde un bombero.","language":{"name":"es","url":"https://pokeapi.co/api/v2/language/7/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"Dopo aver preso la mira colpisce il nemico con\ngetti d’acqua più potenti di quelli di un idrante.","language":{"name":"it","url":"https://pokeapi.co/api/v2/language/8/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"Once it takes aim at its enemy, it blasts out\nwater with even more force than a fire hose.","language":{"name":"en","url":"https://pokeapi.co/api/v2/language/9/"},"version":{"name":"lets-go-eevee","url":"https://pokeapi.co/api/v2/version/32/"}},{"flavor_text":"相手に　狙いを　定めると\n消防車の　ホースより\n強い　勢いで　水を　出す。","languag