name":"it","url":"https://pokeapi.co/api/v2/language/8/"},"version":{"name":"sword","url":"https://pokeapi.co/api/v2/version/33/"}},{"flavor_text":"It crushes its foe under its heavy body to cause\nfainting. In a pinch, it will withdraw inside its shell.","language":{"name":"en","url":"https://pokeapi.co/api/v2/language/9/"},"version":{"name":"sword","url":"https://pokeapi.co/api/v2/version/33/"}},{"flavor_text":"体が　重たく　のしかかって\n相手を　気絶させる。\nピンチの　ときは　殻に　隠れる。","language":{"name":"ja","url":"https://pokeapi.co/api/v2/language/11/"},"version":{"name":"sword","url":"https://pokeapi.co/api/v2/version/33/"}},{"flavor_text":"身体很重，压住对手后\n就能让对手昏厥。\n遇到危险时会躲进壳里。","language":{"name":"zh-Hans","url":"https://pokeapi.co/api/v2/language/12/"},"version":{"name":"sword","url":"https://pokeapi.co/api/v2/version/33/"}},{"flavor_text":"こうらの　ロケットほう　から\nふきだした　ジェットすいりゅうは\nぶあつい　てっぱんも　つらぬく。","language":{"name":"ja-Hrkt","url":"https://pokeapi.co/api/v2/language/1/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"등껍질의 로켓포에서\n뿜어져 나오는 제트 수류는\n두꺼운 철판도 뚫는다.","language":{"name":"ko","url":"https://pokeapi.co/api/v2/language/3/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"從甲殼上的大炮裡\n放出的噴射水流\n足以貫穿厚實的鐵板。","language":{"name":"zh-Hant","url":"https://pokeapi.co/api/v2/language/4/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"Les canons sur sa carapace tirent des jets d’eau\ncapables de percer même de l’acier trempé.","language":{"name":"fr","url":"https://pokeapi.co/api/v2/language/5/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"Die Wassersalven, die es mit den Wasserdüsen\nin seinem Panzer abfeuert, durchdringen sogar\ndicke Stahlwände.","language":{"name":"de","url":"https://pokeapi.co/api/v2/language/6/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"Dispara chorros de agua a través de los cañones\nde su caparazón, capaces de agujerear incluso el\nacero.","language":{"name":"es","url":"https://pokeapi.co/api/v2/language/7/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"I cannoni sul suo guscio sparano getti d’acqua\ncapaci di bucare l’acciaio.","language":{"name":"it","url":"https://pokeapi.co/api/v2/language/8/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"The rocket cannons on its shell fire jets of water\ncapable of punching holes through thick steel.","language":{"name":"en","url":"https://pokeapi.co/api/v2/language/9/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"甲羅の　ロケット砲　から\n噴き出した　ジェット水流は\nぶ厚い　鉄板も　つらぬく。","language":{"name":"ja","url":"https://pokeapi.co/api/v2/language/11/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}},{"flavor_text":"从龟壳上的大炮里\n放出的喷射水流\n足以贯穿厚实的铁板。","language":{"name":"zh-Hans","url":"https://pokeapi.co/api/v2/language/12/"},"version":{"name":"shield","url":"https://pokeapi.co/api/v2/version/34/"}}],"form_descriptions":[],"forms_switchable":true,"gender_rate":1,"genera":[{"genus":"こうらポケモン","language":{"name":"ja-Hrkt","url":"https://pokeapi.co/api/v2/language/1/"}},{"genus":"껍질포켓몬","language":{"name":"ko","url":"https://pokeapi.co/api/v2/language/3/"}},{"genus":"甲殼寶可夢","language":{"name":"zh-Hant","url":"https://pokeapi.co/api/v2/language/4/"}},{"genus":"Pokémon Carapace","language":{"name":"fr","url":"https://pokeapi.co/api/v2/language/5/"}},{"genus":"Panzertier-Pokémon","language":{"name":"de","url":"https://pokeapi.co/api/v2/language/6/"}},{"genus":"Pokémon Armazón","language":{"name":"es","url":"https://pokeapi.co/api/v2/language/7/"}},{"genus":"Pokémon Crostaceo","language":{"name":"it","url":"https://pokeapi.co/api/v2/language/8/"}},{"genus":"Shellfish Pokémon","language":{"name":"en","url":"https://pokeapi.co/api/v2/language/9/"}},{"genus